import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import "./NavBar.css"
class Navbar extends Component {
    render() {
        return (
            <div className="container">

                {/* a light navbar that is responsive for large devices */}
                <nav className="navbar navbar-light navbar-expand-lg bg-light" role="navigation">
                    <a href="#" className="navbar-brand">GSM</a>

                    {/* links */}
                    <ul className="navbar-nav">
                        
                            <li id="pad"className="nav-item">
                                <a href="#" className="nav-link"><span className="p-2">Phones</span></a>
                            </li>
                            <li id="pad1" className="nav-item">
                                <a href="#" className="nav-link"><span className="p-2">MyCart</span></a>
                            </li>

                    </ul>

                </nav>
            </div>
        )
    }
}

export default Navbar;
